type (
	aplReqBody struct {
		PushCertCertificateChain []byte
		PushCertRequestPlist     []byte
		PushCertSignature        []byte
		PushCertSignedRequest    bool
	}

	aplPushCertReq struct {
		Header  aplReqHeader
		Request aplReqRequest
	}

	aplReqHeader struct {
		ClientApplicationCredential string
		ClientApplicationName       string
		ClientIPAddress             string
		ClientOSName                string
		ClientOSVersion             string
		LanguagePreference          string
		TransactionId               string
		Version                     string
	}

	aplCSR struct {
		CSR                     string
		CertRequestNo           int
		CertificateSerialNumber string `plist:"CertificateSerialNumber,omitempty"`
		Description             string
		ServiceType             string
	}

	aplReqRequest struct {
		CertRequestList []aplCSR
		ProfileType     string
		RequesterType   string
		User            aplReqUser
	}

	aplReqUser struct {
		AccountName  string
		PasswordHash string
	}

	aplVendorCert struct {
		Key   []byte
		Chain []byte
	}

	Certificates struct {
		Calendar *tls.Certificate
		Contact  *tls.Certificate
		Mail     *tls.Certificate
		Mgmt     *tls.Certificate
		Alerts   *tls.Certificate
	}
)

func createCertRequestBody(certs *Certificates, username string, passwordhash string) []byte {
	mrand.Seed(time.Now().UnixNano())
	signingCerts := vendorCerts[mrand.Intn(9)]

	buf := bytes.NewBuffer(make([]byte, 0))
	encoder := plist.NewEncoder(buf)

	encoder.Indent("  ")
	encoder.LineLength(68)
	encoder.Escape(false)
	pushCertRequestPlist := createPushCertRequestPlist(certs, username, passwordhash)
	signingKey, err := x509.ParsePKCS1PrivateKey(signingCerts.Key)
	if err != nil {
		log.Fatal(err)
	}
	requestBody := aplReqBody{
		signingCerts.Chain,
		pushCertRequestPlist,
		createPushCertSignature(pushCertRequestPlist, signingKey),
		true,
	}
	err = encoder.Encode(requestBody)
	if err != nil {
		log.Fatal(err)
	}
	return buf.Bytes()
}

